// src/components/GoogleLoginComponent.js
import { useGoogleLogin } from 'react-google-login';

const clientId = "341429096489-06ui4vadr34mvdf28e27e0fktvarjlbh.apps.googleusercontent.com";

const GoogleLoginComponent = ({ onLoginSuccess }) => {
    const { signIn } = useGoogleLogin({
        onSuccess: onLoginSuccess,
        onFailure: (error) => console.error('Login Failed:', error),
        clientId,
        isSignedIn: true,
        accessType: 'offline',
    });

    return <button onClick={signIn}>Login with Google</button>;
};

export default GoogleLoginComponent;
